CortanaConsentPanel.Description:
Lai palīgs Cortana atbildētu uz jūsu jautājumiem, palīdzētu atcerēties svarīgāko un paveiktu daudz ko citu, atļaujiet tam apkopot un izmantot tādu informāciju kā: 

atrašanās vietas un atrašanās vietas vēstures informāciju;

kontaktpersonu informāciju, kalendāra informāciju, kā arī ziņojumu, tērzēšanas ziņu un programmu satura un saziņas vēstures informāciju;

meklēšanas vēsturi un cita veida informāciju, kas pieejama jūsu ierīcē, lai personalizētu lietošanas ērtības
